import { useState } from "react"
import { useNavigate } from "react-router-dom";

function Signup() {
    const [username,setusername] = useState("");
    const [pwd,setPwd] = useState("");
    const navigate = useNavigate();

    const handleSubmit = (e) => {
        e.preventDefault();
        const response = fetch('http://localhost:4000/signup',{
          method : "POST",
          headers : {
            'Accept' : 'application/json',
            'Content-Type' : 'application/json'
          },
          body : JSON.stringify({username : username,password : pwd}),
        })
        console.log(response);
        // const conent = response.JSON();
        // console.log(conent);
        navigate("/login")
    }
    return <div>
        <form onSubmit={handleSubmit}>
        <input name="Username" placeholder="Username" onChange={(e)=>{setusername(e.target.value)}}></input><br/><br/>
        <input name="Password" placeholder="Password" onChange={(e)=>{setPwd(e.target.value)}}></input><br/><br/>
        <button>Submit</button>
       </form>
    </div>
}

export default Signup;
